import React from 'react';
import Paper from "@material-ui/core/Paper";

const Question = ({getQuestionId}) => {

    const q = this.props.getQuestionId(this.props.id);

    return(
        <Paper>
            <h1>Detail's page</h1>  
            <p>{q.title}</p>
        </Paper>
    )
}
export default Question;
